INSERT INTO `t_answer` VALUES (70, 329, 0, 0, 1539268217543, '测试');
INSERT INTO `t_answer` VALUES (71, 329, 14, 0, 1539268232621, 'ok');
INSERT INTO `t_answer` VALUES (72, 329, 14, 1, 1539268244090, '1c5d9c32-7911-4815-81ee-724a93c3d6ed.jpg');
INSERT INTO `t_answer` VALUES (73, 329, 14, 0, 1539268266707, '1');
INSERT INTO `t_answer` VALUES (74, 326, 0, 0, 1539507022433, '原则上是不建议在剖宫产的同时行肌瘤剥除术的，一是很容易引起大出血，二是术后发生感染的风险增加。');
INSERT INTO `t_answer` VALUES (75, 331, 0, 0, 1539507135636, '原则上是不建议在剖宫产的同时行肌瘤剥除术的，一是很容易引起大出血，二是术后发生感染的风险增加。');
INSERT INTO `t_answer` VALUES (77, 331, 18, 0, 1539507232652, '谢谢！');
INSERT INTO `t_answer` VALUES (78, 331, 0, 0, 1539507265644, '一般情况下，妊娠合并子宫肌瘤不是剖宫产的指证，千万不要为了想切除子宫肌瘤而去做剖宫产！');
INSERT INTO `t_answer` VALUES (79, 333, 0, 0, 1539568983480, '有过剖宫产史的女性再次怀孕后并非都要进行再次剖宫产，能否尝试阴道分娩需要具体的咨询产科医生。例如上一次剖宫产手术在子宫上的切口是位于子宫下段的横切口，术中缝合得当，术后恢复好就可以。');
INSERT INTO `t_answer` VALUES (80, 332, 0, 0, 1539568998277, '您好，做试管婴儿前期的相关检查您需要来院一次（最好非经期），取报告需要来院一次，然后是试管婴儿进周期办相关签字手续及定方案来院一次，均为半天，所以您不需要辞职。进试管婴儿周期开始促排卵后会有10天左右来院次数相对频繁，医生可以给您开假条，怀孕后正常生活，适度休息，不需要在家卧床，所以不建议辞职。');
INSERT INTO `t_answer` VALUES (81, 336, 0, 0, 1539569308308, '可以的，经期不影响接种HPV疫苗 。');
INSERT INTO `t_answer` VALUES (82, 334, 0, 0, 1539569322027, '二价和四价疫苗上市已经超过十年，目前研究数据显示，接种人群的抗体水平依然维持在高水平。九价疫苗是在2014年上市的。在对于9-15岁及16-26岁人群的研究显示，血清抗体在疫苗接种后第5年依然维持阳性。');
INSERT INTO `t_answer` VALUES (83, 335, 0, 0, 1539569347051, '目前没有证据显示植入硅胶假体会对母乳喂养的孩子造成不良影响，因为硅胶是惰性的，本身的毒性就比较小，我们很多的家庭日用品（厨具，奶瓶，奶嘴等）和医用材料都是硅胶做的，所以有隆胸植入硅胶假体的母亲是可以母乳喂养的。');
INSERT INTO `t_answer` VALUES (84, 340, 0, 0, 1539573396105, '要怀疑肌瘤变性或者是带蒂肌瘤的扭转。一般会发生在妊娠中期，，有时候会伴发白细胞升高，发热，甚至恶心和呕吐。\n对于肌瘤变性引起的疼痛，建议采用一般的支持疗法，可以使用醋氨酚，又称扑热息痛治疗，如果效果不佳，可以使用非甾体类抗炎药物进行治疗。');
INSERT INTO `t_answer` VALUES (85, 339, 0, 0, 1539573415418, '您好，请您提前安排冷冻精子。');
INSERT INTO `t_answer` VALUES (86, 338, 0, 0, 1539573428738, '不知道是否有可能怀孕？如果排除怀孕的可能，偶尔一次月经异常，通常不会有什么问题。还请您劳逸结合，避免过度劳累。');
INSERT INTO `t_answer` VALUES (87, 337, 0, 0, 1539573441894, '45岁以上的女性再注射HPV疫苗的价值不大，不过超龄的女性朋友们依然不可以对自身健康掉以轻心，需要定期做宫颈癌检查，以检查是否感染了HPV病毒。');
INSERT INTO `t_answer` VALUES (88, 342, 0, 0, 1539573887168, '如果患有轻度霉菌性阴道炎，一般对孩子无妨，但是如果是比较严重的阴道炎，则建议先治疗后再看，在医生的风险评估下，看是进行剖腹产还是顺产。');
INSERT INTO `t_answer` VALUES (89, 341, 0, 0, 1539573897644, '月经期是相对雌激素比较低的时期，有可能会影响情绪。');
INSERT INTO `t_answer` VALUES (90, 343, 0, 0, 1539573959566, '患有子宫肌瘤的患者怀孕以后发生自然流产的风险略有增加，主要是少数粘膜下子宫肌瘤可能会影响受精卵的着床和植入，导致流产的发生。在机制不明确和流产发生率是否增加依然有不同看法的前提下，没有必要“保胎”，也无法“保胎”，更没有必要卧床休息。');
INSERT INTO `t_answer` VALUES (91, 344, 0, 0, 1539576907511, '如果经过专业的妇科肿瘤医师周密评估，为患者选择做腹腔镜手术的话，肯定是能够切干净的。特别是对于病变局限在子宫内、没有扩散到外面的，腹腔镜手术的范围、效果，和开腹手术没有差异。其次，在腹腔镜下面，医生可以更清楚地看到解剖结构，有些在开腹时做不到的区域，在腹腔镜下反而做得更好。');
INSERT INTO `t_answer` VALUES (92, 345, 0, 0, 1539576922371, '男方至少需要来3次，第1次做试管婴儿前体检，第2次签署知情同意书和授权委托书，第3次取卵当天上午必须到场。');
INSERT INTO `t_answer` VALUES (93, 346, 0, 0, 1539577190972, '主要的是要做阴道检查和超声检查来明确出血的部位、原因和程度。');
INSERT INTO `t_answer` VALUES (94, 347, 0, 0, 1539578989676, '您好，在进行试管婴儿治疗中，取卵后，由于之前促排卵药物、HCG扳机及黄体支持的应用，此时卵巢体积较正常显著增大，另外取卵进行了盆腔操作，为了避免卵巢扭转、破裂及盆腔感染的风险，建议您恢复第一次月经后再同房；冻胚移植周期，同样为了避免盆腔感染的风险，建议当月不同房。');
